import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Signup from "./Components/Auth/Signup";
import Login from "./Components/Auth/Login";
import LandingPage from "./Components/LandingPage"; // Assuming you have a LandingPage component
import AddCollaborators from "./Components/AddCollaborators";
import Dashboard from "./Components/Dashboard";
import Themes from "./Components/Themes";
import ThemeSelector from "./Components/ThemeSelector"; // Import the ThemeSelector component

function App() {
  return (
    <Router>
      <div>
        {/* Navigation Bar */}
        <nav className="navbar">
          <ul className="nav-list">
            <li className="nav-item">
              <Link to="/" className="nav-link">Home</Link>
            </li>
            <li className="nav-item">
              <Link to="/signup" className="nav-link">Sign Up</Link>
            </li>
            <li className="nav-item">
              <Link to="/login" className="nav-link">Login</Link>
            </li>
            <li className="nav-item">
              <Link to="/add-collaborators" className="nav-link">Add Collaborators</Link>
            </li>
            <li className="nav-item">
              <Link to="/dashboard" className="nav-link">Dashboard</Link>
            </li>
            <li className="nav-item">
              <Link to="/themes" className="nav-link">Themes</Link>
            </li>
            <li className="nav-item">
              <Link to="/theme-selector" className="nav-link">Theme Selector</Link> {/* Add the new route */}
            </li>
          </ul>
        </nav>

        {/* Routes */}
        <Routes>
          <Route path="/" element={<LandingPage />} />
          <Route path="/signup" element={<Signup />} />
          <Route path="/login" element={<Login />} />
          <Route path="/add-collaborators" element={<AddCollaborators />} />
          <Route path="/dashboard" element={<Dashboard />} />
          <Route path="/themes" element={<Themes />} />
          <Route path="/theme-selector" element={<ThemeSelector />} /> {/* Add the route for ThemeSelector */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
